window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"version":"10.6.0","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"darwin","version":"21.6.0"},"runtime":{"name":"node.js","version":"21.7.0"}}},{"source":{"data":"Feature: Crear page\n\n    @run @pages \n    Scenario: Crear una page con un título y un audio\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba\" como nombre de la página\n        And agrego un audio a la página\n        When publico la página\n        Then abro la sección de \"Pages\"\n        And la página debe existir en la lista\n        And el audio se agregó correctamente\n\n    @run @pages @v5\n    Scenario: Crear una page con un título, un párrafo y un video embebido de YouTube\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Página de prueba YT\" como nombre de la página\n        And ingreso \"contenido de la página con link a youtube\" como contenido de la página\n        And agrego un video embebido de YouTube con link \"https://www.youtube.com/watch?v=edVYLVDDgh0\"\n        When publico la página\n        Then abro la sección de \"Pages\"\n        And la página debe existir en la lista\n        And el video se agregó correctamente\n       \n    @run @pages @v5\n    Scenario: Crear una page básica con una URL definida (slug)\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba con slug\" como nombre de la página\n        And abro las configuraciones de la página\n        And cambio el slug de la página por \"slug-de-prueba\"\n        And cierro las configuraciones de la página\n        When publico la página\n        Then abro la sección de \"Pages\"\n        And la página debe existir en la lista\n        And puedo navegar a la URL con el slug asignado\n\n    @run @pages @debug @v5\n    Scenario: Crear una page básica, previsualizarla y dejarla en borrador\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba con preview\" como nombre de la página\n        And ingreso \"contenido de la página con preview\" como contenido de la página\n        When ingreso a la previsualización\n        Then puedo previsualizar correctamente la página\n        And salgo de la previsualización\n        When guardo el borrador de la página\n        Then la página debe existir en la lista\n        And la página debe tener el estado \"Draft\"","uri":"step_definitions/features/crear-page.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Crear page","description":"","children":[{"scenario":{"id":"3403efb6-6906-4f07-b408-49b8f04f5ebd","tags":[{"location":{"line":3,"column":5},"name":"@run","id":"403acfc4-7409-47df-a2f1-0060612a8c82"},{"location":{"line":3,"column":10},"name":"@pages","id":"263547eb-c563-4733-ba67-32914b6b0ec2"}],"location":{"line":4,"column":5},"keyword":"Scenario","name":"Crear una page con un título y un audio","description":"","steps":[{"id":"3928cc2f-7eeb-46b5-8735-39fdd1320f7b","location":{"line":5,"column":9},"keyword":"Given ","keywordType":"Context","text":"inicio la aplicación"},{"id":"6fa2dfad-424e-4eb3-a547-0e802ec773f0","location":{"line":6,"column":9},"keyword":"And ","keywordType":"Conjunction","text":"inicio sesión si es necesario"},{"id":"ed07d57e-c413-4ee0-9fe2-ed645ebe9c85","location":{"line":7,"column":9},"keyword":"And ","keywordType":"Conjunction","text":"abro la sección ente\n\n    @run @tags \n    Scenario: Crear tag con una imagen\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Tags\"\n        And doy click en \"New tag\"\n        And ingreso \"Tag de prueba con imagen\" como nombre del tag\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\n        And agrego una imagen al tag\n        When guardo el tag\n        Then el tag se guarda exitosamente\n        And abro la sección de \"Tags\"\n        And el tag se encuentra en la lista\n        And abro la página del tag\n        And el tag debe tener la imagen\n\n    @run @tags @v5\n    Scenario: Crear tag con Meta Data\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Tags\"\n        And doy click en \"New tag\"\n        And ingreso \"Tag de prueba con imagen\" como nombre del tag\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\n        And ingreso datos de meta data con título \"Metatitulo\" y descripción \"MetaDesc\"\n        When guardo el tag\n        Then el tag se guarda exitosamente\n        And abro la sección de \"Tags\"\n        And el tag se encuentra en la lista\n        And abro la página del tag\n        And el tag debe contener la información de meta data\n","uri":"step_definitions/features/crear-tag.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Crear Tag","description":"","children":[{"scenario":{"id":"485ea499-3209-4d04-8c4e-15a6508398e4","tags":[{"location":{"line":3,"column":5},"name":"@run","id":"b2b4d0cd-a004-47dd-901e-e5e8b4de8397"},{"location":{"line":3,"column":10},"name":"@tags","id":"c1058acb-6859-4da5-b8f5-0f992fc4397b"},{"location":{"line":3,"column":16},"name":"@v5","id":"f2fc717f-1310-42b4-a397-294872fe8fb9"}],"location":{"line":4,"column":5}, cenario: Cambiar imagen de cover a 8K\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Profile\"\n        And agrego una imagen de cover de 8K\n        When guardo mi perfil\n        Then navego a Home\n        And abro la sección de \"Profile\"\n        And la imagen debe estar en el perfil\n        And elimino la imagen\n        And guardo mi perfil\n\n\n    @run @profile\n    Scenario: Cambiar correo electrónico y nombre\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Profile\"\n        And cambio mi nombre a \"Equipo 20 - 2024\"\n        And cambio mi correo a \"equipo2024@misw4103.com\"\n        When guardo mi perfil\n        Then navego a Home\n        And abro la sección de \"Profile\"\n        And el nombre debe corresponder al nuevo\n        And el correo debe corresponder al nuevo\n        And cambio el nombre y el correo a los originales\n        And guardo mi perfil\n\n    @run @profile\n    Scenario: Anclar los perfiles de redes sociales (facebook y X - twitter)\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Profile\"\n        And cambio mi usuario de Facebook a \"Equipo20\"\n        And cambio mi usuario de Twitter a \"TwEquipo20\"\n        When guardo mi perfil\n        Then navego a Home\n        And abro la sección de \"Profile\"\n        And el usuario de Facebook debe corresponder al nuevo\n        And el usuario de Twitter debe corresponder al nuevo\n        And vacio mi usuario de Facebook\n        And vacio mi usuario de Twitter\n        And guardo mi perfil\n\n    @run @profile\n    Scenario: Ver el historial de actividad del usuario\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Profile\"\n        And selecciono acciones\n        When abro mi historial de actividades\n        Then puedo
